import React from "react";
import { HashRouter as Router, Switch, Route } from "react-router-dom";
import Main from "./components/Main";

import "./App.css";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Main />
        </Route>
        <Route exact path="/"></Route>
      </Switch>
    </Router>
  );
};

export default App;
